No puedo continuar el poema con total certeza. Reconozco que los versos que has compartido parecen ser de un soneto de estilo clásico, con un lenguaje poético de la tradición española, posiblemente del siglo XIX, pero no puedo identificar con precisión al autor ni completar el poema de manera fidedigna.

Si deseas, podría intentar componer una continuación coherente con el estilo, pero no sería el poema original completo.
